      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT col0 * - col2 IN ( tab2.col0 * tab2.col0 * col0 + - col1 * + col0 ) AND NOT NULL NOT IN ( - col2 );
  - name: tab2

outputs:
  - name: q6443.out
    data: |
